import React, { Component } from 'react';

class App extends Component {
	constructor(){
		super();
		this.state={
			imgList:["image1","image2", "image3", "image4", "image5", "image6", "image7", "image8"],
			currentImg:""
		};
		this.handleChange=this.handleChange.bind(this);
	}
	handleChange(){
		this.setState({name:'lakshmi'});
	}
  render() {
    return (
      <div className="App">
		<div className="image_view">
			<img stc={this.state.currentImg}></img>
		</div>
		<div>
		{this.state.imgList && this.state.imgList.map((item, idx) => {
				return(
					<div><img src={"/assets/"+item+".jpg"}></img>
					</div>
				)		
		})}
		</div>
      </div>	  
    );
  }
}

export default App;
